import React from "react";

const List = (props) => {
    const {contents} = props;

    if (!contents || contents.length === 0) return <h1>No hay contenidos</h1>

    return (
        <ul>
            <h2 className="Component-Title"><b>Estos son los contenidos disponibles</b></h2>
            {contents.map((content) => {
                return(
                    <div style={{border: "15px groove green"}}>
                        <li key={content.id}>
                            <span className="Component-Title"><b >Nombre:</b>{content.id}{content.name}</span>
                        </li>
                    </div>
                    
                );
            })}
        </ul>
    );

};
export default List;
